import { useContext } from 'react';
import { AuthContext } from '../../contexts/Auth/AuthContext';
import { Link } from 'react-router-dom';
import './styles.css';

export const Private = () => {
  const auth = useContext(AuthContext);
  const handleLogout = async () => {
    await auth.signOut();
    window.location.reload();
  };
  return (
    <div>
      <div className="App">
      <div className="b2bit">
        <img src={process.env.PUBLIC_URL + "/b2bit-escuro.svg"} alt="Logo da B2Bit" className="logo"/>
        <p>E-mail</p>
        <input
          type="text"
          value={email}
          onChange={handleEmailInput}
          placeholder="@gmail.com"
          className="form"
        />
        <p>Password</p>
        <input
          type="password"
          value={password}
          onChange={handlePasswordInput}
          placeholder="****************"
          className="form"
        />
        <button onClick={handleLogin} className="button">
          <Link className="button" to="/private">Sign In</Link>
        </button>
      </div>
    </div>
      <header className="bg-secondary p-4">
        <nav>
          <button className="bg-primary text-white px-4 py-2 rounded">
            <Link to="/">Log in</Link>
          </button>
          <Link to="/private">Página Privada</Link>
          {auth.user && <button onClick={handleLogout}>Sign Out</button>}
        </nav>
      </header>
      <h2>Página Privada</h2>
      Your <strong>Name</strong>
      {auth.user?.name}
      Your <strong>E-mail</strong>
      {auth.user?.email}
    </div>
  );
};
